import React, { useState, useEffect } from 'react';
import { fetchExecutionDetailsGrouped, updateExecutionDetails } from '../services/api';

const ExecutionDetailsPage = () => {
  const [executions, setExecutions] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadExecutions = async () => {
      try {
        const data = await fetchExecutionDetailsGrouped();
        setExecutions(data);
      } catch (err) {
        console.error('❌ Error fetching execution details:', err);
      } finally {
        setLoading(false);
      }
    };

    loadExecutions();
  }, []);

  const handleStatusChange = async (executionId, newStatus) => {
    try {
      await updateExecutionDetails(executionId, { status: newStatus });
      setExecutions((prev) =>
        prev.map((exec) => (exec._id === executionId ? { ...exec, status: newStatus } : exec))
      );
    } catch (err) {
      console.error('❌ Error updating execution status:', err);
    }
  };

  const handleDateReceivedChange = async (executionId, newDate) => {
    try {
      await updateExecutionDetails(executionId, { dateReceived: newDate });
      setExecutions((prev) =>
        prev.map((exec) => (exec._id === executionId ? { ...exec, dateReceived: newDate } : exec))
      );
    } catch (err) {
      console.error('❌ Error updating date received:', err);
    }
  };

  return (
    <div className="container">
      <h2>Execution Management</h2>
      {loading ? (
        <p>Loading execution details...</p>
      ) : (
        <table border="1">
          <thead>
            <tr>
              <th>Process</th>
              <th>Vendor</th>
              <th>Line Item</th>
              <th>Order</th>
              <th>Weight Sent</th>
              <th>Pieces Sent</th>
              <th>Date Sent</th>
              <th>Date Received</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {executions.map((exec) => (
              <tr key={exec._id}>
                <td>{exec.processInfo?.name || exec.processId}</td>
                <td>{exec.vendorInfo?.name || exec.vendorId}</td>
                <td>{exec.lineItemId}</td>
                <td>{exec.orderId}</td>
                <td>{exec.outWeight}</td>
                <td>{exec.piecesSent}</td>
                <td>{exec.dateSent}</td>
                <td>
                  <input
                    type="date"
                    value={exec.dateReceived || ''}
                    onChange={(e) => handleDateReceivedChange(exec._id, e.target.value)}
                  />
                </td>
                <td>{exec.status}</td>
                <td>
                  <select
                    value={exec.status}
                    onChange={(e) => handleStatusChange(exec._id, e.target.value)}
                  >
                    <option value="Pending">Pending</option>
                    <option value="In Progress">In Progress</option>
                    <option value="Complete">Complete</option>
                  </select>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default ExecutionDetailsPage;
